import React from "react";
import { Link } from "react-router-dom";

import Logo from "../Logo";

import Social from "../Social";

import "./HeaderMobile.css";

const Header = () => {
	return (
		<header className="mobile flex f-col jc-start">
			<div className="hamburger flex f-col">
				<span className="line line-01" />
				<span className="line line-02" />
				<span className="line line-03" />
			</div>
			<div className="menu flex">
				<Link to="/">
					<Logo color="light" />
				</Link>
				<nav>
					<ul>
						<Link to="/">
							<li>Homepage</li>
						</Link>
						<Link to="/rules">
							<li>Entry Rules</li>
						</Link>
						<Link to="/rules">
							<li>Brave.co.uk</li>
						</Link>
						<Link to="/termsAndconditions">
							<li>T'S &amp; C'S</li>
						</Link>
					</ul>
					<Social color="light" />
				</nav>
			</div>
		</header>
	);
};

export default Header;
